(1, '404 Not Found 1', 'one_column', 'Page keywords', 'Page description', 'no-route', NULL, '<div class="page-title">\r\n<h1>Whoops, our bad...</h1>\r\n</div>\r\n<dl><dt>The page you requested was not found, and we have a fine guess why.</dt><dd>\r\n<ul class="disc">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul>\r\n</dd></dl><dl><dt>What can you do?</dt><dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd><dd>\r\n<ul class="disc">\r\n<li><a onclick="history.go(-1); return false;" href="#">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br /><a href="{{store url=""}}">Store Home</a> <span class="separator">|</span> <a href="{{store url="customer/account"}}">My Account</a></li>\r\n</ul>\r\n</dd></dl>', '2014-09-19 11:14:00', '2014-10-27 15:46:20', 1, 0, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'Home page', 'two_columns_right', NULL, NULL, 'home', NULL, '\r\n<div class="hidden">\r\n<h2>Home Page</h2>\r\n</div>', '2014-09-19 11:14:00', '2015-11-25 21:40:14', 1, 0, '<reference name="promotion">\r\n	 <block type="ves_productcategories/list" name="cat-home" before="-"/>\r\n</reference>\r\n<reference name="masstop1">\r\n         <block type="ves_deals/carousel" name="ves.carousel1" as="ves.carousel1"  />\r\n</reference>\r\n<reference name="masstop2">\r\n         <block type="ves_blog/latest" name="ves_latest1" as="ves_latest1"/>\r\n</reference>\r\n<reference name="masstop3">\r\n         <block type="ves_productcarousel2/list" before="-" name="productcarousel2.list"/>\r\n         <block type="ves_productcarousel3/list" name="productcarousel3.list"/>\r\n</reference>', NULL, NULL, NULL, NULL, NULL),
