(7, 1, 'VesTheme Control Panel is the module on Magento Theme', 'ves_theme', '<p>VesTheme Control Panel is the module on Magento Theme. That is a the most important module to control your theme. It can help you customize,configure your theme very easily and flexiblely, you can make a new nices theme as expected in very short time. In this blog post, we would like to guide you how to configure VesTheme Control Panel In Opencart Shop. We will use Pav Foodstore Opencart theme - a great responsive Magento theme provided by Venustheme like example.</p>', '<div class="page-header">\r\n<h3>Gerenal Tab</h3>\r\n<hr class="notop" /></div>\r\n<p>When installation is complate :</p>\r\n<p><img src="http://www.venustheme.com/guides/ves_controlpanel/assets/images/image_4.jpg" alt="" /></p>\r\n<p><strong>Go to General Tab</strong></p>\r\n<p><img src="http://www.venustheme.com/guides/ves_controlpanel/assets/images/image_6.jpg" alt="" /></p>\r\n<p>The general tab allows you to configure the skin theme, copyright,enable some configurations</p>\r\n<p>&nbsp;</p>\r\n<p><strong>1. Skin Setting</strong></p>\r\n<p>Select a skin that you want the current style applies. Each skin goes with one style.</p>\r\n<p><img style="border-width: 0px; border-style: solid;" src="http://www.venustheme.com/guides/ves_controlpanel/assets/images/image_5.jpg" alt=" " /></p>\r\n<p><strong>2. Copyright</strong></p>\r\n<p>Pavo Themes allows you to select your copyright <strong>when you purchase our theme with developer version</strong>. Choose yes on Enable Custom Copyright. Filling informations you want in textbox</p>\r\n<p><img style="border-width: 0px; border-style: solid;" src="http://www.venustheme.com/guides/ves_controlpanel/assets/images/image_1.png" alt="" /></p>\r\n<p>&nbsp;</p>\r\n<p><strong>3. Some configure</strong></p>\r\n<p><img style="border-width: 0px; border-style: solid;" src="http://www.venustheme.com/guides/ves_controlpanel/assets/images/image_14.jpg" alt="" /></p>\r\n<ul>\r\n<li><strong>Enable Off-Canvas Siderbars</strong>: This option is applied for collapse menu in small screen like ipad or mobile. This setting is shown in the above section (<strong>OffCanvas Siderbars</strong>)</li>\r\n<li><strong>Enable Footer Center</strong>: This option is applied Footer Center in the bottom section</li>\r\n<li><strong>Enable Panel Tool</strong>: This option is applied Panel Tool. This setting is shown only in full screen.</li>\r\n<li><strong>Enable Ajax Cart</strong> : &nbsp;Choose yes or no.</li>\r\n<li><strong>Enable Quick View</strong> : Set enable quickview of product or note.</li>\r\n<li><strong>Enable Swap Image</strong>: Set enable swap image of productsby choose yes.</li>\r\n<li><strong>Header </strong>: Set header scrolling when you scroll your site</li>\r\n</ul>\r\n<p><strong>4. Template Layout Setting</strong></p>\r\n<p><img src="http://www.venustheme.com/guides/ves_controlpanel/assets/images/image_13.jpg" alt="" /></p>', '2014-11-02 19:22:12', '2014-11-02 19:22:12', 1, '', '', '', 1, 'magento, VesTheme', 'blog/blog_1.jpg', 6, 0, NULL, NULL),
(8, 1, 'Ves Megamenu Module', 'ves_megamenu', '<p>Venustheme developed the back-end control tools that allow you to Drag and Drop any Content such as Text, HTML, Video Image as layer to play on each slider.</p>', '<div class="page-header">\r\n<h3>Ves MegaMenu</h3>\r\n<hr class="notop" /></div>\r\n<p>Venusthemes includes the fantastic Megamenu in an additional module called <em>Ves MegaMenu</em>.The Megamenu module comes with a custom admin interface through which you can create powerfull Menu. No coding is required. Follow these steps to create a module:</p>\r\n<p><strong>Front-end Appearance:</strong></p>\r\n<p><strong><img class="img-responsive" src="http://www.venustheme.com/guides/ves_bags/assets/images/image_8.jpg%7Eoriginal" alt="" /></strong></p>\r\n<p>&nbsp;</p>\r\n<p><img class="img-responsive" src="http://www.venustheme.com/guides/ves_bags/assets/images/image_9.jpg%7Eoriginal" alt="" /></p>\r\n<p><strong>*Tip:</strong> If you want to show border top color menu Item, you can add some class in menu item config of megamenu:</p>\r\n<p>&nbsp;</p>\r\n<p><img class="img-responsive" src="http://www.venustheme.com/guides/ves_bags/assets/images/image_28.jpg%7Eoriginal" alt="" /></p>\r\n<p>&nbsp;</p>\r\n<p><img class="img-responsive" src="http://www.venustheme.com/guides/ves_bags/assets/images/image_29.jpg%7Eoriginal" alt="" /></p>\r\n<p>&nbsp;</p>\r\n<p><strong>Back-end Using</strong>:</p>\r\n<p>go to <strong>admin &gt; VenusTheme &gt; Ves Megamenu &gt; Manage Menu Items</strong></p>\r\n<p><img class="img-responsive" src="http://www.venustheme.com/guides/ves_bags/assets/images/image_4.jpg%7Eoriginal" alt="" /></p>\r\n<p><strong>Manage Widgets:</strong></p>\r\n<p><strong><img class="img-responsive" src="http://www.venustheme.com/guides/ves_bags/assets/images/image_10.jpg%7Eoriginal" alt="" /></strong></p>\r\n<p>Use Widget to inset into your megamenu.</p>\r\n<p>Click Create Widget to create new widget.</p>\r\n<p><img class="img-responsive" src="http://www.venustheme.com/guides/ves_bags/assets/images/image_46.jpg" alt="" /></p>\r\n<p><strong>Widget Types:</strong> select widget types you want to create. A lot of choice for you.</p>\r\n<p>Example:</p>\r\n<ul>\r\n<li>HTMLl</li>\r\n<li>Categories list</li>\r\n<li>Products category</li>\r\n<li>Products list</li>\r\n<li>Products</li>\r\n<li>Static block</li>\r\n<li>Video code</li>\r\n<li>Image</li>\r\n<li>Feed</li>\r\n<li>Last Venus Blog</li>\r\n</ul>\r\n<p><strong>Widget Name:</strong> set widget name</p>\r\n<p>Fill all information you want,then click <strong>Save</strong> to create new widget.</p>\r\n<p><strong>Live MegaMenu Editor</strong></p>\r\n<p><img class="img-responsive" src="http://i1022.photobucket.com/albums/af350/thonglm122/03-28-1416-16-40_zps1d5b5ddf.png%7Eoriginal" alt="" /></p>\r\n<p>It is powerful and easy tool of pavotheme to create specialty and flexibility megamenu without coding.</p>\r\n<p><strong>Create new sub Menu</strong></p>\r\n<p>Click titile menu you want to add submenu, popup Sub Menu Setting will be appeared.</p>\r\n<ul>\r\n<li><strong>Create Submenu:</strong> choose yes to enable submenu.</li>\r\n<li><strong>Width of Submenu Wrapper: </strong>set width of submenu (pixels)</li>\r\n<li><strong>Add Row:</strong> click to add new row of submenu</li>\r\n<li><strong>Remove Active Row:</strong> click to remove active row</li>\r\n<li><strong>Add Column:</strong> click to add new column in row</li>\r\n</ul>\r\n<p><img class="img-responsive" src="http://www.venustheme.com/guides/ves_bags/assets/images/image_47.jpg" alt="" /></p>\r\n<p><strong>Create new columns and insert Widget</strong></p>\r\n<p>when you click on new column (1) , popup "Column Setting" (3) and "Widget Setting" (2) will be displayed</p>\r\n<p><img class="img-responsive" src="http://www.venustheme.com/guides/ves_bags/assets/images/image_48.jpg" alt="" /></p>\r\n<p><strong>Widget Setting (2):</strong> select widget that was created by Manager Widget then click <strong>Insert </strong>to insert widget in column</p>\r\n<p><strong>Column Setting (3):</strong></p>\r\n<ul>\r\n<li><strong>Addition Class:</strong> set class name of column</li>\r\n<li><strong>Column Width:</strong> select width of column with values from 1-&gt;12. that mean one row can add maximum 12 columns</li>\r\n<li><strong>Remove Active Column:</strong> click to remove column you choose</li>\r\n</ul>\r\n<p><strong>Finish Setting</strong></p>\r\n<p>After configure all setting you can click button:</p>\r\n<ul>\r\n<li><strong>Add Widget (1):</strong> click to open popup create new Widget</li>\r\n<li><strong>Preview On Live Site(2): </strong>click to preview megamenu in popup of your site</li>\r\n<li><strong>Reset Mega Menu Configuration(3):</strong> click to reset configuration</li>\r\n<li><strong>Save(4):</strong> click to save new megamenu</li>\r\n</ul>\r\n<p><img class="img-responsive" src="http://www.venustheme.com/guides/ves_bags/assets/images/image_49.jpg" alt="" /></p>', '2014-11-02 19:28:25', '2014-11-02 19:28:25', 1, '', '', '', 2, 'ves, megamenu', 'blog/blog_2.jpg', 5, 8, NULL, NULL),
(9, 1, 'Magento Is the Fastest Growing eCommerce Platform Provider on the IR Top 500', 'magento-is-the-fasstest-growing-ecommerce', '<p>The <a href="http://www.internetretailer.com/top500/" target="_blank">2014 IR Top 500 Guide</a> has been released and Magento has overtaken Demandware to join Oracle and IBM as the top three providers to the top 500 internet retailers in the US and Canada. Magento has 34 merchants on the latest edition of the IR Top 500 list, doubling the number of merchants from the 2013 list. Magento clients include marquee brands like COACH and fast-growing brands and retailers like Alex and Ani, Zumiez, and Signature Hardware.</p>', '<div class="field-items">\r\n<div class="field-item even"><img src="http://magento.com/sites/default/files/3532_BlogHeader_IR_Top500_r1_v5.1.jpg" alt="" width="644" height="362" /></div>\r\n</div>\r\n<div class="row-fluid">\r\n<div class="span12">\r\n<div class="field field-name-body field-type-text-with-summary field-label-hidden">\r\n<div class="field-items">\r\n<div class="field-item even">\r\n<p>The <a href="http://www.internetretailer.com/top500/" target="_blank">2014 IR Top 500 Guide</a> has been released and Magento has overtaken Demandware to join Oracle and IBM as the top three providers to the top 500 internet retailers in the US and Canada. Magento has 34 merchants on the latest edition of the IR Top 500 list, doubling the number of merchants from the 2013 list. Magento clients include marquee brands like COACH and fast-growing brands and retailers like Alex and Ani, Zumiez, and Signature Hardware.</p>\r\n<p><img style="float: left; height: 362px; margin: 10px; width: 644px;" src="http://magento.com/sites/default/files/images/Main%20Graph%20for%20Blog%20644x362.png" alt="" />&ldquo;The doubling of our presence on the IR Top 500 is a great advance and clearly demonstrates the ability of Magento products to scale to support merchants doing hundreds of millions of dollars in online revenue,&rdquo; says Roy Rubin, Co-Founder and COO of Magento.</p>\r\n<p>Magento products are now the top platforms for midmarket merchants&mdash;defined by Internet Retailer as those with $20M-$75M in annual online sales. Magento grew from 13 midmarket merchants on the list in 2013 to 24 in 2014, overtaking Oracle in the top spot in this segment. Together with eBay Enterprise&rsquo;s Enterprise Commerce Platform, eBay-owned platforms combined have extended their lead as the top provider to midmarket merchants.</p>\r\n<p><img style="float: left; height: 362px; margin: 10px; width: 644px;" src="http://magento.com/sites/default/files/images/Midmarket%20Graph%20for%20Blog%20644x362.png" alt="" />With 57 total merchants, the two platforms combined put eBay Enterprise second only to Oracle on the 2014 IR Top 500.</p>\r\n<p>&ldquo;This advance in our position on the IR Top 500 is more evidence of the power and momentum of our combined commerce solutions and expertise backed by the resources of eBay,&rdquo; said Mark Lavelle, SVP of Strategy and Product at eBay Enterprise, adding &ldquo;Beyond this important benchmark, eBay Enterprise is becoming the clear partner of choice&mdash;and one who will never compete with you&mdash;for a vast and growing number of SMBs, mid-market and enterprise merchants around the globe.&rdquo;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '2014-11-02 19:28:35', '2014-11-02 19:28:35', 1, '', '', '', 3, 'magento, top 500, ves', 'blog/blog_3.jpg', 5, 0, NULL, NULL),
(10, 1, 'How to Add Products in Magento', 'add-products-in-magento', '<p>In this tutorial we''ll cover one of the most important aspects of managing your online store - your products. Once you read it, you will know how to add new products and manage your existing ones and how to add images and tags to them.</p>', '<p>The following steps are the same for all product types.&nbsp; Subsequent sections describe the difference between each of the product types.</p>\r\n<h3>Creating a Simple Product</h3>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>In the Admin Panel, choose Catalog &gt; Manage Products.\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>Click <strong>Add Product</strong>on the top right to create a new product.\r\n<p>&nbsp;</p>\r\n</li>\r\n<li>In the following page, select an attribute set from the drop-down menu. To learn more about attributes and attribute sets, see &ldquo;Managing Attributes and Attribute Sets&rdquo;.<br />\r\n<p class="kb-notes"><strong>TIP:</strong> You should first define attributes of a product, as described in the Managing Product Attributes section, before you define products that have that attribute.</p>\r\n</li>\r\n<li>Click <strong>Continue</strong> to view the New Product Editor page, displayed below:<br /> <img class="kb-images" src="http://www.magentocommerce.com/images/uploads/Product_Gen_Info.png" alt="image" width="550" height="343" />\r\n<h4>General Product Configuration Settings</h4>\r\n<p>Fill in all the required fields, which are indicated by a red asterisk (*). The General Info fields include the following:</p>\r\n<p><strong>Name:</strong> The Product name as you would like it to appear in your store.</p>\r\n<p><strong>Description:</strong> This appears at the center of your product page for default templates, and should provide your customers with an accurate product report.</p>\r\n<p><strong>Short Description:</strong> This appears to the right of your product page.&nbsp; You should provide a more brief description of your product, ideally broken down with bullet points.</p>\r\n<p><strong>SKU (Stock Keeping Unit):</strong> This is a unique identifier for each individual product and service that can be provided.&nbsp; SKUs are often used to refer to different versions of the same product.&nbsp; For example, a retail store carrying Guitar Hero 3 might have six SKUs, two for each of the three platforms.</p>\r\n<p><strong>Weight:</strong> The actual mass of the product. Typically this is used for shipping calculations.</p>\r\n<p><strong>Status:</strong> Specifies that the product is available in the store.&nbsp; If it ever becomes temporarily unavailable, you can remove it from store views by changing this field to Disabled.</p>\r\n<p><strong>Visibility:</strong> Specifies where you would like your product to be viewed. The available options are: <strong>Not Visible Individually</strong> (recommended for Configurable Product Type); <strong>Catalog</strong> (products are displayed only in catalog pages); <strong>Search</strong> (products are displayed in search result pages only); <strong>Catalog</strong>, <strong>Search</strong> (products are displayed in both catalog and search result pages).</p>\r\n</li>\r\n<li>Click <strong>[ Save ]</strong> to save your changes.</li>\r\n</ol>\r\n<h3>Adding Product Images</h3>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Click the Images tab in the Product Information panel on the left.</li>\r\n<li>Click <strong>Browse Files</strong> and select the desired product images from your file system.<br />\r\n<p class="kb-notes"><strong>TIP:</strong> You can repeat this step to insert additional images before uploading files.</p>\r\n</li>\r\n<li>When you have selected all your images, click <strong>Upload Files</strong> to upload all selected images to your store.</li>\r\n<li>For each image you have uploaded, provide the following information:\r\n<p><strong>Label:</strong> Alternate text for the image tag. This feature is useful for SEO management.</p>\r\n<p><strong>Sort Order:</strong> The order in which the images are displayed in the Slideshow and MORE VIEWS option.</p>\r\n<p><strong>Thumbnail:</strong> Used in the shopping cart and related items.</p>\r\n<p><strong>Small Image:</strong> Used in the Category listing, wish list, and so on.</p>\r\n<p><strong>Base Image:</strong> Large product images for zooming.</p>\r\n<p><strong>Exclude:</strong> Select an image if you do not want it to appear in the gallery of MORE VIEWS on the product page.</p>\r\n<p><strong>Remove:</strong> Select an image to remove from the collection. All selected images will be removed upon saving.</p>\r\n<p class="kb-notes"><strong>TIP:</strong> Magento Go automatically resizes your main product image for each of these sizes so you only need to upload your base image once. Alternatively, for better image management, resize your product&rsquo;s images in an image editor and upload them to each image type.</p>\r\n</li>\r\n<li>Click <strong>[ Save ]</strong> to save changes.</li>\r\n</ol>\r\n<h3>Assigning Your Product to a Category</h3>\r\n<p>To assign your product to a category:</p>\r\n<ol>\r\n<li>Select the Categories tab in the Product Information panel on the left.</li>\r\n<li>Click the checkbox next to each category you want that product to appear in. Clicking the [+] icon will expand that category and reveal its subcategories.<br /> <img class="kb-images" src="http://www.magentocommerce.com/images/uploads/Product_Categories.png" alt="image" width="184" height="162" /></li>\r\n<li>Click <strong>[ Save ]</strong> to save your changes.</li>\r\n</ol>\r\n<h3>Configuring Price Information</h3>\r\n<ol>\r\n<li>Click the Prices tab in the Product Information panel on the left.</li>\r\n<li>The Prices fields include the following:\r\n<p><strong>Cost:</strong> Represents what an item actually costs you (the store owner).&nbsp; It is used only in the back-end, and can be used for generating revenue reports.</p>\r\n<p><strong>Tax Class:</strong> Taxation of different products may vary from product to product, as well as in the shipping of different products.&nbsp; Magento Go provides the options None, Taxable Goods, and Shipping.&nbsp; Select the appropriate option for the products you are selling.</p>\r\n<p><strong>Special Price:</strong> If you will be offering discounts or promotions for particular product, simply add a special price in the allocated field. You can define the promotion period by entering the start and end dates for the promotion in the To and From field dates, using the calendar icon or by manual entry.&nbsp; An example of how special pricing will appear in your store appears below:</p>\r\n</li>\r\n<li>Click <strong>[ Save ]</strong> to save your changes.</li>\r\n</ol>\r\n<h3>Configuring Inventory Information</h3>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Click the Inventory tab in the Product Information panel on the left.</li>\r\n<li>The Inventory fields include the following:<br /> <img class="kb-images" src="http://www.magentocommerce.com/images/uploads/Product_Inventory.png" alt="image" width="515" height="197" />\r\n<p>strong&gt;Qty: Specifies the quantity, or how many units you currently possess in your inventory.</p>\r\n<p><strong>Stock Availability:</strong> You can specify whether or not an item is In Stock or Out of Stock</p>\r\n</li>\r\n<li>Click <strong>[ Save ]</strong> to save your changes.</li>\r\n</ol>\r\n<h3>What if Your Product Does Not Appear?</h3>\r\n<p>If your product does not appear in your store, check the following settings in your product data:</p>\r\n<p>Status is <em>Enabled</em> in the <strong>General</strong> tab.</p>\r\n<p><strong>Visibility</strong> is set to include catalog in the <strong>General</strong> tab.</p>\r\n<p><strong>Inventory</strong> value is non-zero in the <strong>Inventory</strong> tab.</p>\r\n<p><strong>Stock Availability</strong> is set to <em>In Stock</em> in the <strong>Inventory</strong> tab.</p>\r\n<p>Product is assigned to a website in the <strong>Categories</strong> tab.</p>\r\n<p>Product is assigned to a category in the <strong>Categories</strong> tab.</p>\r\n<h3>Optional Recommended Features</h3>\r\n<p>Depending on your store&rsquo;s needs, Magento Go provides a high level of optional customization features.</p>\r\n<h3>Configuring Meta Information</h3>\r\n<p>Meta information helps search engines find your product. The Meta Information fields appear below: <img class="kb-images" src="http://www.magentocommerce.com/images/uploads/MetaInformation.png" alt="image" width="550" height="374" /></p>\r\n<p>The <strong>Meta Information</strong> tab is for specifying metadata for a product. Metadata is descriptive information about a page that search engines can use to index your store&rsquo;s product pages. This content is not visible directly on your website.</p>\r\n<p><strong>Meta Title:</strong> Specify a title for your product&rsquo;s page. This title can be seen at the top bar of a web browser.</p>\r\n<p><strong>Meta Keywords:</strong> Specify keywords that are relevant to the product. It is helpful to consider keywords that potential customers may search if they were searching for your products with a search engine.</p>\r\n<p><strong>Meta Description:</strong> Write a few sentences describing the content on the page. Though it is not visible on your page itself, some search engines will list this page&rsquo;s search result using the meta description text.</p>\r\n<p class="kb-notes"><strong>NOTE:</strong> Read our <a href="http://www.magentocommerce.com/go/support/kb/category/name/expand-your-store/"><em>Expand your Store</em> Knowledge Base</a> articles for more information about Search Engine Optimization.</p>\r\n<h3>Configuring Optional Inventory Settings</h3>\r\n<p>To configure optional inventory settings:</p>\r\n<p><strong>Manage Stock:</strong> Select Yes if the inventory options are available for this single product to manage your inventory. Select No to specify that you do not want to manage product inventory (in which case, the product will be made permanently available to your customers in your store).</p>\r\n<p><strong>Stock Availability:</strong> Select the In Stock Option if you want customers to be able to purchase this product.</p>\r\n<p><strong>Qty Uses Decimals:</strong> This field is used for products such as those sold in units of length, weight, or some other measure. If your products require customers to enter decimal quantities, as opposed to integers, select Yes.</p>\r\n<p><strong>Backorders:</strong> If your store&rsquo;s inventory is promptly refreshed, and there is no reason for your store to prevent customers from ordering beyond the specified inventory limits, then you can change this option to Allow Qty Below 0. If you want the customer to be notified about the backorder upon purchase, you can select Allow Qty Below 0 and Notify Customer.</p>\r\n<p><strong>Maximum/Minimum Qty Allowed in Shopping Cart:</strong> This allows you to limit the availability of a product.&nbsp; For example, if a company sold bottles of wine, they could offer a low price on bottles if customers buy the case, in which case they would set the minimum amount to six and over.&nbsp; Alternatively, you can set the maximum limit in order to limit the quantity of each product sold per customer.</p>\r\n<p><strong>Qty for Item&rsquo;s Status to become Out of Stock:</strong> This field specifies a level at which a product will become out of stock.</p>\r\n<h3>Configuring Product Relationships</h3>\r\n<p>In addition to providing a wide range of product types, Magento Go also enables you to create relationships between products to support accessorizing, up-sells, and cross-sells. The key types of product relationships that are provided by Magento Go are:</p>\r\n<p><strong>Related Products:</strong> This option is designed to aid your customers&rsquo; shopping experience as well as coax them into adding products to their carts.&nbsp; It can be as vague or as specific as you choose.&nbsp; A product related to an iPod Shuffle could be an iPod Nano, or it could be an iMac, or a set of stereo speakers.&nbsp; It is up to you just how related you want to make it.</p>\r\n<p><strong>Up-sells:</strong> This option enables you to recommend an upgraded version of the products that your customers select. The promotion appears when products are viewed.&nbsp; For example, if a customer selects a standard mobile phone from your products, you could attempt to up-sell them to a smart phone.&nbsp; It does not need to be more expensive necessarily; it could be a product that yields a greater profit margin, or one of better quality.</p>\r\n<p><strong>Cross-sell:</strong> This option enables you a last chance to offer your customers an impulse buy.&nbsp; They are products promoted in the shopping cart page right before checkout.&nbsp; This would be similar to items such as candy or magazines that are available around the register at the grocery store.&nbsp; They might not be related products, but they are products you would like to entice your customers into buying upon check out.</p>\r\n<h3>Adding Related Products to a Product</h3>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Click the Related Products tab in the Product Information panel on the left.</li>\r\n<li>In the product grid, click <strong>Reset Filter</strong> in the upper right to show all the products you have created, or use the fields in the first row of the product grid to find specific products.</li>\r\n<li>From the resulting list, select the check box in the first column for any products you want to add to the related products list for this product.</li>\r\n<li>Click <strong>[ Save ]</strong> to save your changes.</li>\r\n</ol>\r\n<h3>Adding Up-Sell Products to a Product</h3>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Click the Up-Sells tab in the Product Information panel on the left.</li>\r\n<li>In the product grid, click <strong>Reset Filter</strong> in the upper right to show all the products you have created, or use the fields in the first row of the product grid to find specific products.</li>\r\n<li>From the resulting list, select the check box in the first column for any products you want to add to the up-sell products list for this product.</li>\r\n<li>Click <strong>[ Save ]</strong> to save your changes.</li>\r\n</ol>\r\n<h3>Adding Cross-Sell Products to a Product</h3>\r\n<p>&nbsp;</p>\r\n<ol>\r\n<li>Select the Cross-Sells tab in the Product Information panel on the left.</li>\r\n<li>In the product grid, click <strong>Reset Filter</strong> in the upper right to show all the products you have created, or use the fields in the first row of the product grid to find specific products.</li>\r\n<li>From the resulting list, select the check box in the first column for any products you want to add to the cross-sell products list for this product. If you define more cross-sell products than there are spaces available, Magento Go will display different products from the cross-sell list each time the cart page is reloaded.</li>\r\n<li>Click <strong>[ Save ]</strong> to save your changes.</li>\r\n</ol>', '2014-11-02 19:28:45', '2014-11-02 19:28:45', 1, '', '', '', 4, 'add product, magento', 'blog/blog_4.jpg', 5, 2, NULL, NULL),
(11, 1, 'How to configure Magento Payment methods', 'configure-magento-payment-methods', '<p>Magento provides different payment methods in order to allow you to accept payments using different payment processors like Paypal, Authorize.net and many more.</p>', '<p>To configure you payment methods in Magento, first you need to login to your Admin area. Then, go to <strong>System -&gt; Configuration -&gt; Sales -&gt; Payment Methods</strong>.</p>\r\n<p><img src="http://www.siteground.com/img/knox/tutorials/uploaded_images/images/magento/new/48.jpg" alt="" width="560" height="300" /></p>\r\n<p>For the purpose of this tutorial we will enable the credit card payment method. This method can be configured through the <strong>Saved CC</strong> section:</p>\r\n<p><img src="http://www.siteground.com/img/knox/tutorials/uploaded_images/images/magento/new/34.jpg" alt="" width="560" height="300" /></p>\r\n<p>Enable the method, enter its title, set the new order status, pick the supported credit cards, decide whether the credit card verification is required, define from which countries to accept payments and the range of the accepted payments.</p>\r\n<p>In the Sort order field you should enter the position of this payment method compared to the other payment methods offered to the customers. That''s it, you have just enabled this payment method for your customers. Since all payment methods have different configurations, we cannot explain in details how to configure each one of them. Simply follow the instructions on their specific pages and they should work.</p>', '2014-11-02 19:29:09', '2014-11-02 19:29:09', 1, '', '', '', 4, 'magento, payment', 'blog/blog_5.jpg', 5, 5, NULL, NULL),
(12, 1, 'How to configure Magento Shipping methods', 'how-to-configure-magento-shipping-methods', '<p>We will create three shipping methods that provide a fixed shipping price, allow for free shipping promotions, define logic based on an item&rsquo;s weight and, finally, make it all configurable in the admin panel.</p>', '<p>To configure your Magento Shipping methods, you need to login to your admin area and go to <strong>System -&gt; Configuration -&gt; Sales -&gt;Shipping Methods</strong>.</p>\r\n<p><img src="http://www.siteground.com/img/knox/tutorials/uploaded_images/images/magento/30.jpg" alt="" width="560" height="300" /></p>\r\n<p>Before enabling the shipping method you should configure the shipping settings from <strong>System -&gt; Configuration -&gt; Sales -&gt; Shipping Settings</strong>.</p>\r\n<p><img src="http://www.siteground.com/img/knox/tutorials/uploaded_images/images/magento/new/32.jpg" alt="" width="560" height="300" /></p>\r\n<p>Expand the <strong>Origin</strong> section. Enter the address from which the shipping will be initiated. Usually this is the address of the warehouse where the products are stored.</p>\r\n<p>Then expand the <strong>Options</strong> section. If enabled, the option <strong>Allow Shipping to Multiple Addresses</strong> allows goods from a single order to be shipped to different addresses. It is useful when a customer orders many products of a single kind, like post cards or pens for example and wants them to be delivered to multiple addresses. You can define the maximum number of allowed shipping addresses in the <strong>Maximum Qty Allowed for Shipping to Multiple Addresses</strong> field.</p>\r\n<p>For example, to enable the USPS shipping module, you can go to <strong>System -&gt; Configuration -&gt; Sales -&gt; Shipping Methods</strong> and navigate to the <strong>USPS</strong> section:</p>\r\n<p><img src="http://www.siteground.com/img/knox/tutorials/uploaded_images/images/magento/new/33.jpg" alt="" width="560" height="300" /></p>\r\n<p>Enable the shipping method, enter the <strong>Gateway URL</strong> and the <strong>UserID</strong>. The next options allow you to describe the packages which you need to be delivered (size, weight and more).</p>\r\n<p>Then you can define the handling fee. It can be fixed or calculated on the percent basis. After this you can pick the allowed delivery methods. Also, you can configure a free shipping method and define whether there is a minimum purchase sum for it.</p>\r\n<p>At the end you can define the countries for which the shipping is supported and the default error message in case the service is refused. In the Sort order field you should enter the&nbsp; position of this shipping method compared to the other shipping methods offered to the customers.</p>', '2014-11-02 19:29:25', '2014-11-02 19:29:25', 1, '', '', '', 5, 'shipping', 'blog/blog_6.JPG', 6, 14, NULL, NULL),
(13, 1, 'How to manage pages in Magento CE1.9', 'how-to-create-and-manage-pages-in-magento', '<p>CMS (Content Management System) pages are static pages such as your Homepage, About Us, and Customer Service pages that provide information about a web store and are managed through the Backend panel. CMS pages are full pages that are available via their own URL address.</p>', '<p>In order to manage your web site pages you need to navigate to the <strong>CMS</strong> section in the Magento admin area. Click on the <strong>Manage Pages</strong> link in order to proceed with the pages modification.</p>\r\n<p><img alt="" src="http://www.siteground.com/img/knox/tutorials/uploaded_images/images/magento/new/23.jpg" height="300" width="560" /></p>\r\n<p>You can edit a page by clicking on it. The <strong>Edit Page</strong> will open the window below:</p>\r\n<p><img alt="" src="http://www.siteground.com/img/knox/tutorials/uploaded_images/images/magento/new/24.jpg" height="300" width="560" /></p>\r\n<p>You can modify this page to your preference. <strong>Static blocks</strong> is another useful option. For example, you can edit the footer block which contains the links located at the bottom of your main page:</p>\r\n<p><img alt="" src="http://www.siteground.com/img/knox/tutorials/uploaded_images/images/magento/new/25.jpg" height="300" width="560" /></p>\r\n<p>The <strong>Polls</strong> section allows you to create and edit polls:</p>\r\n<p><img alt="" src="http://www.siteground.com/img/knox/tutorials/uploaded_images/images/magento/new/26.jpg" height="300" width="560" /></p>\r\n<p>Actually, magento has a fully-featured CMS system integrated in it. Browse through the pages to see the different elements you can add to your site.</p>', '2015-06-24 20:01:28', '2015-06-24 20:01:28', 1, '', '', '', 7, 'magento pages', 'blog/blog_7.jpg', 6, 22, NULL, NULL),
(14, 1, 'Ecological Effects', 'coffe', '<p>Coffee cultivation first took place in southern Arabia, the earliest credible</p>', '<p>Have you ever wondered how to change careers or start a home business without big expenses or risks? Gain financial freedom with Coffee News<em>&reg;, </em>the world&rsquo;s most popular restaurant publication.</p>\r\n<p>Coffee News<em>&reg; </em>is one of the simplest and best business ideas of the last 25 years! One of <em>Forbes</em> and <em>Entrepreneur</em>&rsquo;s highest-ranked affordable franchises, Coffee News<em>&reg; </em>entertains and informs readers, promotes local business and allows people just like you to make money working from home.<em> </em></p>\r\n<p>Coffee News<em>&reg;</em> franchisees (called publishers) create their own schedules, make a difference in their communities and reap real profits. Owning a Coffee News<em>&reg; </em>franchise provides a clear path to financial freedom. If you have a passion for sales and community involvement, you can earn money from home with Coffee News<em>&reg;</em>.</p>', '2014-11-03 02:49:48', '2014-11-03 02:49:48', 1, '', '', '', 0, 'magento, venusthem, ves', 'blog/coffee_1.jpg', 5, 0, NULL, NULL),
(15, 1, 'Grading the roasted seeds', 'coffee', '<p>Coffee is no longer thought to be a risk factor for coronary heart disease.</p>', '<p>What is... Coffee News&reg; is a light and entertaining paper that patrons can pick up at their favourite Restaurant, Coffee Shop, waiting room, reception area, and anywhere where people go to meet. Coffee News&reg; offers the week''s funniest and most unusual news stories, jokes, trivia, amazing facts, and more.</p>\r\n<p>Coffee News also provides an opportunity for Small and Medium sized Businesses throughout Alberta and Saskatchewan to advertise within their local market.</p>', '2014-11-03 02:50:00', '2014-11-03 02:50:00', 1, '', '', '', 0, 'coffee, venus', 'blog/coffee_2.jpg', 5, 1, NULL, NULL),
(16, 1, 'World production', 'coffee-world', '<p>Coffee is a brewed beverage prepared from the roasted or baked seeds</p>', '<ul class="latestnews_events">\r\n<li class="latestnews_events"><strong>Ongoing - Seniors Lunch</strong> <br />\r\n<p>All seniors are welcome to join us for a luncheon held every Wednesday from 11:30 - 1:00. Come join us for great food and great fellowship. Bring all your friends. Cost is only $3.00 per person. The Peace Place, 4900 - 93 ave. Edmonton See you there!</p>\r\n</li>\r\n<li class="latestnews_events"><strong>November 15 - Hazeldean Christmas Craft Sale</strong> <br />\r\n<p>November 15 &amp; 16 from 10am-4pm. Location: 9630-66 Ave. Lots of hand crafted items; treasures from exotic countries; and a few small businesses as well. Coffee and snacks available at the concession. Admission $1. www.hazeldean.org</p>\r\n</li>\r\n<li class="latestnews_events"><strong>November 29 - Mill Woods United Church Christmas Craft Fair</strong> <br />\r\n<p>Mill Woods United Church is holding its annual Christmas Craft Fair on November 29 from 10:00 - 4:00 p.m. at Mill Woods United Church; located at 15 Grand Meadow Crescent (east of 66 St. on 38 Avenue. Admission by donation. Door prizes and concession.</p>\r\n</li>\r\n</ul>', '2014-11-03 02:50:11', '2014-11-03 02:50:11', 1, '', '', '', 0, 'coffee, venusthem, ves', 'blog/coffee_3.jpg', 5, 0, NULL, NULL);
